import React from "react"
import LeftBackGroundCover from "../../organisms/leftHalfBackgroundCover"
import LoginForm from "../../organisms/forms/login"
import LogoHeading from "../../molecules/logoHeading"
import styles from './styles.js';

const Login = (props) => {
    return (

        <div>

            <div className="leftSide">
                <LeftBackGroundCover/>
            </div>
            <div class= "rightSide">
                <div class= "header">
                <LogoHeading text="Welcome back! Please login to your account." />
                </div>
                <div class= "content">
                    <LoginForm/>
                </div>
                <div class= "footer">

                </div>
            </div>
            <style jsx>{`

            .leftSide {
                margin-right: 50%
            }
            .rightSide {
                margin-left: 50%
            }
            .header{
                margin: 10%
            }
            `}</style>
        </div>
    )
}

export default Login
